import React from "react";
import NavBar from "./NavBar";
import "./Main.css";
import FadeIn from "react-fade-in";

function Main() {
  return (
    <div className="main">
      <div className="main__wrapper">
        <NavBar />
        <div className="main__home_wrapper">
        <FadeIn delay={700} transitionDuration={800}>
          <div className="main__descritption">
            <div className="main__descritption-text">
              <a className="main__descritption-text__title">
                Willkommen zu BetSmart!
              </a>
            </div>
          </div>

          <div className="main__descritption">
            <div className="main__descritption-text">
              <a>
                WIR BAUEN – IHRE WÜNSCHE UND TRÄUME WIR BAUEN – IHRE WÜNSCHE UND
                TRÄUME
              </a>
            </div>
          </div>
        </FadeIn>
        </div>
      </div>



    </div>
  );
}

export default Main;
